% final combinations
% patch motion
resp0 = [a0 b0 c0 d0 e0];
resp90 = [a90 b90 c90 d90 e90];
resp180 = [a180 b180 c180 d180 e180];
resp270 = [a270 b270 c270 d270 e270];
% global motion
globalResp0 = [ga0 gb0 gc0 gd0 ge0];
globalResp90 = [ga90 gb90 gc90 gd90 ge90];
globalResp180 = [ga180 gb180 gc180 gd180 ge180];
globalResp270 = [ga270 gb270 gc270 gd270 ge270];

%% create lists of ROIs to plot
% here we apply cutoff, separate by motion response, etc.
cutoff = 0.5;
% to check opposite directions : mod((0+180),360)
% LISTS TO ADD TO:
% only resp. to direction listed, and no other
list0 = [];
list90 = [];
list180 = [];
list270 = [];
gList0 = [];
gList90 = [];
gList180 = [];
gList270 = [];

% iterate thru ROI resps. and add indices to list
for roi=1:length(eROI.roi)
    % resps. to evaluate
    temp0 = resp0(roi);
    temp90 = resp90(roi);
    temp180 = resp180(roi);
    temp270 = resp270(roi);
    % evaluate by cutoff and add to lists
    if (temp0>=cutoff && temp90<cutoff && temp180<cutoff && temp270<cutoff)
        list0 = [list0; roi];
    elseif (temp90>=cutoff && temp0<cutoff && temp180<cutoff && temp270<cutoff)
        list90 = [list90; roi];
    elseif (temp180>=cutoff && temp90<cutoff && temp0<cutoff && temp270<cutoff)
        list180 = [list180; roi];
    elseif (temp270>=cutoff && temp90<cutoff && temp180<cutoff && temp0<cutoff)
        list270 = [list270; roi];
    end
    % repeat for global    
    gTemp0 = globalResp0(roi);
    gTemp90 = globalResp90(roi);
    gTemp180 = globalResp180(roi);
    gTemp270 = globalResp270(roi);
    if (gTemp0>=cutoff && gTemp90<cutoff && gTemp180<cutoff && gTemp270<cutoff)
        gList0 = [gList0; roi];
    elseif (gTemp90>=cutoff && gTemp0<cutoff && gTemp180<cutoff && gTemp270<cutoff)
        gList90 = [gList90; roi];
    elseif (gTemp180>=cutoff && gTemp90<cutoff && gTemp0<cutoff && gTemp270<cutoff)
        gList180 = [gList180; roi];
    elseif (gTemp270>=cutoff && gTemp90<cutoff && gTemp180<cutoff && gTemp0<cutoff)
        gList270 = [gList270; roi];
    end
end

